//|                 OPENSCAD SAVONIUS ROTOR                  |<br />
//|                    2014 <a data-cfemail="caadabb0a3afa68aada7aba3a6e4a9a5a7" href="https://www.thingiverse.com/cdn-cgi/l/email-protection" class="__cf_email__" >[email&#160;protected]</a>                 |<br />
//|see <a rel="nofollow" href="http://fr.wikipedia.org/wiki/Rotor_de_Savonius" >http://fr.wikipedia.org/wiki/Rotor_de_Savonius</a>        |<br />
//|or <a rel="nofollow" href="http://en.wikipedia.org/wiki/Savonius_wind_turbine" >http://en.wikipedia.org/wiki/Savonius_wind_turbine</a>     |<br />
//+----------------------------------------------------------+<br />
Diametre_base=100;                                      //base diameter (D)<br />
ecart=16;                                                       //central Gap - ecart (e)<br />
epaisseur=5;                                                    //thinkness ( base and max'wing)<br />
hauteur=100;                                                    //height<br />
diametre_pale=(Diametre_base/2)+(ecart/2); //wing diameter<br />
//try to get 0.166666666666666<br />
echo(&quot;best : 0.15 &lt; &quot;, ecart/Diametre_base ,&quot;&lt; 0.17&quot;);<br />
Twist=90;                                       //Wings of Fury<br />
n_pale=2;                                       //number of wings -<br />
$fa=1;<br />
$fs=1;<br />
savonius();<br />
module savonius(){<br />
base();<br />
rotor2(); //impose ton style ! choose rotor1() or rotor2()<br />
//  top(); //or not ?<br />
}<br />
module rotor1(){<br />
for (i=[1:n_pale]){<br />
rotate([0,0,i<em >(360/n_pale)]){<br />
translate([-diametre_pale/2+ecart/2,0,0]){<br />
linear_extrude(height=Diametre_base,convexity=100,twist=Twist){<br />
difference(){<br />
circle(r=diametre_pale/2);<br />
translate([0,epaisseur,0]) circle(r=diametre_pale/2);<br />
}<br />
}<br />
}<br />
}<br />
}<br />
}<br />
module rotor2(){<br />
for (i=[1:n_pale]){<br />
color([0.5+sin(10</em>i)/2,0,1/i]){<br />
rotate([0,0,i<em >(360/n_pale)]){<br />
translate([-diametre_pale/2+ecart/2,0,0]){<br />
linear_extrude(height=Diametre_base,convexity=100,twist=Twist){<br />
difference(){<br />
circle(r=diametre_pale/2);<br />
circle(r=(diametre_pale/2)-epaisseur/2);<br />
translate([-Diametre_base,0,0,])square(Diametre_base</em>2);<br />
}<br />
}<br />
}<br />
}<br />
}<br />
}<br />
}<br />
module base(){<br />
difference(){<br />
color(&quot;CadetBlue&quot;)cylinder(r=Diametre_base/2, h=epaisseur);<br />
translate([0,0,-epaisseur]) cylinder(r=3, h=3*epaisseur); //change r=3 as your preference<br />
}<br />
}<br />
module top(){<br />
color(&quot;SteelBlue&quot;)translate([0,0,hauteur])cylinder(r=Diametre_base/2, h=epaisseur);<br />
}
